import React from "react";
import fbChecklist from "../data";

function fbCategoryB() {
  return (
    <div className="category-head">
      {fbChecklist.map((fbChecklistLine) => {
        const {id, category, text} = fbChecklistLine;
        return (
          <article>
            <div>{text}</div>
          </article>
        )
      })}
    </div>
  )
}

export default FbCategoryB;
